	doc.DOC_ID,
	dm.DOC_Desc as Doc_Name,
	doc.crw_id,
	doc.crd_number,
	doc.crd_country,
	doc.crd_issued,
	doc.crd_expiry,
	dst.DST_Description [Document Status],
	doc.CRD_Place,
	doc.crd_isprimarydocument,
	doc.CRD_CreatedOn,
